import React from "react";
import { BrowserRouter, Route, Routes, useNavigate } from "react-router-dom";
import "./App.css";
import Form from "./components/Form";
import Table from "./components/Table";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/">
          <Table />
        </Route>
        <Route path="/form/:id">
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
